import React from 'react';
import Header from './components/Header';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div>
      <Header />

      <div className="container">
        <form className="mt-3" id="form">
            <div className="input-group">
                <input type="text" className="form-control" placeholder="Search Movie" aria-describedby="button-addon" />
                <div className="input-group-append">
                    <button className="btn btn-secondary btn-submit" type="submit" id="button-addon">Search</button>
                </div>
            </div>
        </form>
      </div>
    </div>
  );
}

export default App;
